import roadmap from '../images/roadmap.png';
import rats from '../images/rats.gif';
import chumvx from '../images/chumvx.gif';
import '../styles/Roadmap.css';

function Roadmap() {
  return (

    <div className="Roadmap">
      <header className="Roadmap-header">
        <hr style={{color: '#00fff2', width: 300}}/>
      <h1><br/>Roadmap</h1>
         <p className="Peque"><b style={{color: '#00fff2'}}>Level 1.</b> <b style={{color: '#946cf2'}}>Free to Claim Drops:</b> Don't fall into the Right-click-save-image scheme anymore, With the Chumpass you will have your ChumCut and your ChumBucket for free, and you can add it to your NFTs in a completely official way</p>
        <img src={roadmap} className="Roadmap-logo" alt="Roadmap"/>
        <p className="Peque"><b style={{color: '#00fff2'}}><br/><hr style={{color: '#00fff2', width: 300}}/><br/><br/> Level 2.</b> <b style={{color: '#946cf2'}}>Chum VX and Chumland:</b> You will get the official Chum avatar for The Sandbox, with which you can walk around and have fun in any metaverse. We also have plans to build a meme city called Chumland.</p>
        <img src={chumvx} className="Roadmap-logo" alt="Chum VX"/>
        <p className="Peque"><b style={{color: '#00fff2'}}><br/><hr style={{color: '#00fff2', width: 300}}/><br/><br/> Level 3.</b> <b style={{color: '#946cf2'}}>Generative Chum Collection:</b> Imagine Chum with a lot of traits and different hairstyles... or imagine a lot of infested rats with all those things... This last part will be put to a vote by all Chumpass holders, we will make the best generative NFT meme collection of all time.</p>
        <img src={rats} className="center" alt="Rats" style={{maxWidth: "1000px"}}/>
      </header><br/><br/><br/><hr style={{color: '#00fff2', width: 300}}/>
    </div>
  );
}

export default Roadmap;
